import React, { Component } from 'react';
import Logo from './Logo';
import '../styles/Home.css';
class Home extends Component {
    constructor(props){
        super(props);
    }
    render() {
        return (
            <div>
                <Logo />
                <div>
                    <ul>
                        <li>
                            Events
                        </li>
                        <li>
                            Savings
                        </li>
                        <li>
                            Recipes
                        </li>

                    </ul>
                </div>
            </div>
        );
    }
}

export default Home;
